import { Component } from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component {

  constructor() {
    super();
    this.state = {
      monsters: [
        { 
          name: 'Linda',
          id: 'e3e33' 
      },
        { 
          name: 'Frank',
          id: 'f47fj'
      },
        { 
          name: 'Jacky',
          id: '7eene' 
      },
        { 
          name: 'Andrew',
          id: 'jf876e'
      }
      ]
    }
  }

  render() {
    return (
      <div className="App">
        {
          this.state.monsters.map((monster) => {
            return <h1 key={monster.id}>{monster.name}</h1>;
          })
        }
      </div>
    );
  }
}

export default App;
